function HomePage() {
    return (<>
        <div className="container-fluid position-relative bg-success main-div ">

            <div className="position-relative  main1 d-grid text-center align-item-center bg-primary over-dib-b  align-self-center">
                <h3 className=""> Elevate <span class="fw-bold">Real Estate Success</span> with</h3>
                <h3> Osumare's Digital Expertise</h3>
                <p className="fs-5">Tailored Solutions for Thriving in the Digital Real Estate Landscape</p>

                <div className="position-absolute bg-danger end-0  text-end over-div">
                    <h1>
                        skbaskkaskb
                    </h1>
                </div>
            </div>


        </div>

    </>);
}
export default HomePage;
